import './Style.css';

export default function Navbar() {
    return (
        <div> 
            <img src={image_navbar}/>
            <div>
                    <h1 className="d-flex justify-content-center">
                        Star Wars movies
                    </h1>
                    <form> 
                        <input />
                    </form>
            </div>
        </div>

    );
};
